import React from "react";
import { Link } from "react-router-dom";
import s from './Landing.module.css'

function LandingPage(){
    return (
        <div className={s.container}>
          <h1 className={s.welcome_title}>Recipe Book</h1>
          <h3 className={s.welcome_subtitle}>What will we cook today?</h3>
          <Link to="/home">
            <button className={s.btn_landing_page}>Enter Site</button>
          </Link>
        </div>
      )
    };




export default LandingPage
